import React from 'react'
import '../App.css';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

function Register() {

    return (
        <form>
            <TextField label="Email"/>
            <TextField label="Password"/>

            <Button type="submit">
                Register
            </Button>
        </form>
    );
}

export default Register;
